import React from 'react';


const style_block = {
  display: 'block',
}

const style_inline = {
  display: 'flex',
}

const Inputs_left = () => {

  return (<div style={style_block}>
    <div style={style_inline}>
      <label style={style_block}>Текст:<input type="text"></input></label>

      <label style={style_block}>Текст:<input type="text"></input></label>
    </div>
    <div>
      <label for="Company">Назва компанії, організації:</label>
      <input name="company" id="Company" type="text" ></input>
    </div>
    <label for="Name">Last Name:</label>
    <input name="last_name" id="Last_Name" type="text" ></input>
    <div>

      <label for="Name">Last Name:</label>
      <input name="last_name" id="Last_Name" type="text" ></input>
    </div>
  </div >
  );

}

export default Inputs_left;
